import React from "react";
import Card from "./Card";
import Contacts from"../contacts";

function App() {
console.log(Contacts);

  return (
    <Card 
     name = {Contacts[0].name}
     img = {Contacts[0].img}
     tel = {Contacts[0].tel}
     email = {Contacts[0].email}
    />
  );
}

export default App;
